INSERT INTO `blog_article` VALUES ('5743fa7719724407b99ab6c911a80f10', '十一天深度体验 Model 3 之后，我想把它推荐给每一个人', '<p>这十一天开下来，我想把它推荐给每一个人。</p><p>它可能是你见过最酷最有科技感的车，但同时又很实用，<span>更重要的是，买得起。</span></p><p>这篇我会用最平实的语言，介绍 Model 3 的几大亮点，以及大家最关心的一些问题。争取让大家「一篇看懂 Model 3」。</p><h2 id=\"ss-H2-1550461645214\">极简设计：什么都「没有」的 Model 3</h2><p>Model 3 的设计完美诠释了「超前」二字，极简的程度甚至超过了它的前辈 Model S / X 。</p><p>首先，Model 3&nbsp;<span>没有车钥匙</span>。</p><p>每辆 Model 3 配有两张钥匙卡片，你可以用它刷卡开门、启动车辆。</p>', '汽车', 0, 'cc', NULL, NULL, '/ggblog/upload/article/pics/86ef99d7-1ce6-4501-ba94-3cabb3a6156f.jpeg', NULL, 'admin', '2019-02-20 08:37:14', 'admin', '2019-03-27 15:16:29', 'Model 3', '0', '0');
INSERT INTO `blog_article` VALUES ('c66a0993f9224f5ba0a09261c4a66e8f', 'Spring Cloud（零）：微服务的那些事儿', '<p style=\"text-align: justify;\">Spring Cloud 是一系列框架的有序集合。它利用 Spring Boot 的开发便利性巧妙地简化了分布式系统基础设施的开发，如服务发现注册、配置中心、消息总线、负载均衡、断路器、数据监控等，都可以用 Spring Boot 的开发风格做到一键启动和部署。Spring 并没有重复制造轮子，它只是将目前各家公司开发的比较成熟、经得起实际考验的服务框架组合起来，通过 Spring Boot 风格进行再封装屏蔽掉了复杂的配置和实现原理，最终给开发者留出了一套简单易懂、易部署和易维护的分布式系统开发工具包。</p><p style=\"text-align: justify;\">本文主要讲述我们为什么选择 Spring Cloud 和它的技术概览。</p><h1 id=\"什么是微服务\" style=\"text-align: justify;\"><a href=\"https://windmt.com/2018/04/14/spring-cloud-0-microservices/#%E4%BB%80%E4%B9%88%E6%98%AF%E5%BE%AE%E6%9C%8D%E5%8A%A1\" class=\"headerlink\" title=\"什么是微服务\"></a>什么是微服务</h1><p style=\"text-align: justify;\">要了解 Spring Cloud 就绕不开微服务这个概念。因为 Spring Cloud 是 Spring 为微服务架构思想做的一个一站式实现。从某种程度是可以简单的理解为，微服务是一个概念、一个项目开发的架构思想。Spring Cloud 是微服务架构的一种 Java 实现。</p><p style=\"text-align: justify;\">微服务的概念源于 Martin Fowler 于 2014 年 3 月 25 日写的一篇文章&nbsp;<a href=\"https://martinfowler.com/articles/microservices.html\" target=\"_blank\" rel=\"noopener\">Microservices</a>（中文版翻译<a href=\"http://www.cnblogs.com/liuning8023/p/4493156.html\" target=\"_blank\" rel=\"noopener\">点击查看</a>）</p><p><a id=\"more\" style=\"text-align: justify;\"></a><span style=\"text-align: justify;\"></span></p><p style=\"text-align: justify;\">微服务架构模式（Microservices Architecture Pattern）的目的是将大型的、复杂的、长期运行的应用程序构建为一组相互配合的服务，每个服务都可以很容易得局部改良。 Micro 这个词意味着每个服务都应该足够小，但是，这里的小不能用代码量来比较，而应该是从业务逻辑上比较——符合&nbsp;<a href=\"https://en.wikipedia.org/wiki/Single_responsibility_principle\" target=\"_blank\" rel=\"noopener\">SRP 原则</a>的才叫微服务。</p>', '学习', 0, 'cc', NULL, NULL, '/ggblog/upload/article/pics/64b569c5-b97e-404d-bcaa-1130d2679e7a.jpeg', NULL, 'admin', '2019-02-20 07:51:10', 'admin', '2019-03-27 15:16:15', ' Spring Cloud 技术概览', '0', '0');
